import NavBar from "./components/Navbar";
import AboutMe from "./components/AboutMe";
import Greetings from "./components/Greetings";
import TechStack from "./components/TechStack";
import Contact from "./components/Contact";
import { useState, useRef } from "react";

function App() {
  const aboutRef = useRef(null);
  const techStackRef = useRef(null);
  const contactRef = useRef(null);

  const [, setAboutHeight] = useState(0);
  const [, setTechHeight] = useState(0);
  const [, setContactHeight] = useState(0);

  try {
    console.log("about : " + aboutRef.current.offsetHeight);
  } catch {
    console.log("about is null");
  }
  try {
    console.log("tech : " + techStackRef.current.offsetHeight);
  } catch {
    console.log("tech is null");
  }
  try {
    console.log("contact : " + contactRef.current.offsetHeight);
  } catch {
    console.log("contact is null");
  }

  const sectionInfo = {
    about: aboutRef,
    techStack: techStackRef,
    contact: contactRef,
  };

  return (
    <NavBar sectionInfo={sectionInfo}>
      <Greetings />
      <AboutMe ref={aboutRef} setter={setAboutHeight} />
      <TechStack />
      <Contact />
    </NavBar>
  );
}

export default App;
